import "react-multi-carousel/lib/styles.css";
import styled from "styled-components";
import { RelativeContainer, Title } from "../../styles/Styles";
import factorit from "./../../assets/img/experience/factorit.svg";
import glamit from "./../../assets/img/experience/glamit.svg";
import redbee from "./../../assets/img/experience/redbee.svg";
import sanju from "./../../assets/img/experience/sanju.png";
import { TimelineCard } from "./TimelineCard";

const steps = [
  <TimelineCard
    image={redbee}
    title="redbee"
    classname="redbee"
    location="left"
    position="Fullstack developer"
    description={
      "Web and Mobile development. Front and back end using Flutter and Java. Part of Partners pics build."
    }
  />,
  <TimelineCard
    image={glamit}
    classname="glamit"
    title="Glamit"
    location="right"
    position="Front end developer"
    description={
      "Frontend developer using ReactJS and Less, Ecommerce builder."
    }
  />,
  <TimelineCard
    image={factorit}
    classname="fit"
    title="FactorIT"
    location="left"
    position="Fullstack developer"
    description={"Web development, working building Walmart apps."}
  />,

  <TimelineCard
    image={sanju}
    classname="sjt"
    location="right"
    title="Instituto TÃ©cnico Industrial San Judas Tadeo"
    position="Profesor"
    description={"IT professor, algorythms and C develompent."}
  />,
];

export const Experience = () => (
  <RelativeContainer>
    <FlexContainerColumn id="experience">
      <Title>My career</Title>
    </FlexContainerColumn>

    <Timeline>
      <Box>
        <Container>
          <Lines>
            <Dot />
            <Line />
            <Dot />
            <Line />
            <Dot />
            <Line />
            <Dot />
            <Line />
          </Lines>

          <Cards>{steps.map((card) => card)}</Cards>
        </Container>
      </Box>
    </Timeline>
  </RelativeContainer>
);

const FlexContainerColumn = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  margin: auto;
  @media (max-width: 768px) {
    width: 100%;
    padding: 0;
  }
`;

const Timeline = styled.div`
  margin: auto;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const Container = styled.div`
  overflow: hidden;
  display: flex;
  * {
    margin: 0;
  }
  @media (max-width: 768px) {
    width: 100%;
    padding: 0;
  }
`;

const Box = styled.div`
  display: flex;
`;

const Cards = styled.div`
  margin-left: 12px;
  .card {
    h4 {
      font-family: Open Sans;
      font-style: normal;
      font-weight: bold;
      font-size: 14px;
      line-height: 19px;
      margin-left: 25px;
      margin-bottom: 5px;

      color: #2b2862;
    }

    p {
      font-family: Open Sans;
      font-style: normal;
      font-weight: normal;
      font-size: 16px;
      line-height: 22px;

      color: #2b2862;
      margin-left: 25px;
    }
  }
`;

const Lines = styled.div`
  margin-left: 40px;
  margin-top: 6px;
  transform: translateY(50px);
`;

const Line = styled.div`
  height: 140px;
  width: 4px;
  background: #d1d6e6;
  margin-left: 5.3px;
`;
const Dot = styled.div`
  width: 14px;
  height: 14px;
  background: #d1d6e6;
  border-radius: 7px;
`;
